import React, { useEffect, useState, useRef } from 'react';



const [coordinates, setCoordinates] = useState(() => {
  // getting stored value
  const saved = localStorage.getItem("coordinates");
  const initialValue = JSON.parse(saved);
  return initialValue || "";
});
